import {Routes,Route} from 'react-router-dom'
import './App.css';
import Home from './pages/Home/Home.js';
import Registration from './pages/Registration/Registration';

function App() {
  return (

    <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/registration" element={<Registration/>}/>
    </Routes>
  );
}

export default App;
